} from "react-icons/fa";
import { MdFlutterDash } from "react-icons/md";
function Skills() {
  return (
    <div>
      <h1>Skills</h1>
      <div className="d-flex flex-row">
        <FaHtml5 />
        <FaFlutter />
      </div>
    </div>
  );
}

export default Skills;
